import { BrowserRouter, Routes,Route} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from "./pages/Home";
import Admin from "./pages/Login/Admin";
import Patient from "./pages/Login/Patient";
import Doctor from "./pages/Login/Doctor";
import Patientx from "./pages/Register/Patientx";
import Doctorx from "./pages/Register/Doctorx";
import WithHeaderStyledExample from "./pages/Question/ReadbypatientId";
import KitchenSinkExample from "./pages/Question/ReadbydoctorId";
import Doctors from "./pages/Viewprofiles/Doctors";
import Patients from "./pages/Viewprofiles/Patients";
import ToggleButtonGroupUncontrolled from "./pages/Appointment/BookAppointment";
function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
        <Route path = "/" element = {<Home/>}/>
        <Route path = "/login-admin" element = {<Admin/>}/>
        <Route path = "/login-patient" element = {<Patient/>}/>
        <Route path = "/login-doctor" element = {<Doctor/>}/>
        <Route path = "/signup-patient" element = {<Patientx/>}/>
        <Route path = "/signup-doctor" element = {<Doctorx/>}/>
        <Route path = "/questions" element = {<WithHeaderStyledExample/>}/>
        <Route path = "/answers" element = {<KitchenSinkExample/>}/>
        <Route path = "/doctors" element = {<Doctors/>}/>
        <Route path = "/patients" element = {<Patients/>}/>
        <Route path = "/appointment" element = {<ToggleButtonGroupUncontrolled/>}/>
        <Route path = "/appointmentId" element = {<K/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
